import api from "../api";

export async function buscaUsuario() {
  try {
    const resultado = await api.get();

    return resultado.data;
  } catch (error) {
    console.log(error);
    return {};
  }
}

export async function criaFinancas(body) {
  try {
    const resultado = await api.post('/informValor', body);
    return resultado.data;
  } catch (error) {
    console.log(error);
    return error
  }
}
export async function deletaUsuario(body) {
  try {
    const resultado = await api.post('/informValor', body);
    return resultado.data;
  } catch (error) {
    console.log(error);
    return error
  }
}
